tinsert(l,m(221,g({lvl=19,description="Situated along the Zoram Strand of Ashenvale, Blackfathom Deeps was once a glorious temple dedicated to the night elves' moon-goddess, Elune. However, the great Sundering shattered the temple - sinking it beneath the waves of the Veiled Sea. There it remained untouched - until, drawn by its ancient power - the naga and satyr emerged to plumb its secrets. Legends hold that the ancient beast, Aku'mai, has taken up residence within the temple's ruins. Aku'mai, a favored pet of the primordial Old Gods, has preyed upon the area ever since. Drawn to Aku'mai's presence, the cult known as the Twilight's Hammer has also come to bask in the Old Gods' evil presence.",coords={{14,11.1,1440}}},{n(-17,{q(6565,g({maps={1440},lvl=17,sourceQuests={6564},races=a2,qgs={12736},coords={{11.6,34.3,1440}}},{i(17695),i(17694)})),q(6921,{maps={1440},qgs={12736},races=a2,lvl=21,coords={{11.6,34.3,1440}}}),q(6922,g({races=a2,altQuests={909},lvl=21},{i(16886),i(16887)})),q(1200,g({sourceQuests={1198},qgs={4787},altQuestID=6561,lvl=18},{i(7002),i(7001)})),q(1198,{maps={1438},qgs={4786},lvl=18,isBreadcrumb=1,coords={{28.7,52.1,1438}}}),q(971,g({maps={1455},qgs={2786},races=a1,lvl=10,coords={{50.8,5.6,1455}}},{i(6743)})),q(1275,g({maps={1439},qgs={8997},races=a1,lvl=18,coords={{38.3,43,1439}}},{i(7003),i(7004)})),q(6563,{maps={1440},lvl=17,sourceQuests={6562},races=a2,qgs={12736},coords={{11.6,34.3,1440}}}),q(6562,{maps={1442},lvl=17,qgs={11862},races=a2,isBreadcrumb=1,coords={{47.3,64.4,1442}}}),q(1199,g({maps={1438},qgs={4784},races=a1,lvl=20,coords={{38.3,43,1438}}},{i(7000),i(6998)}))}),n(0,{i(1454,{crs={4798,4799,4805,4809,4810,4811,4812,4813,4814,4819,4820,4823,4825,4827,12876,12902}}),i(5952),i(3414,{crs={4798,4799,4805,4809,4810,4811,4812,4813,4814,4819,4820,4823,4825,4978,12876,12902}}),i(16790,g({crs={4802},races=a2,coords={{14,11.1,1440}}},{q(6564,{maps={1440},qgs={12736},races=a2,coords={{11.6,34.3,1440}}})})),i(3413,{crs={4789,4798,4799,4803,480